     Deadly Sting: The Mercury Years
[________________________________________]
Deadly Sting is a compilation album of hits and previously unreleased material by the German hard rock band Scorpions.
The songs were culled from their catalog on the Mercury label.
Deadly Sting was released both as a single disc in 1995 and an expanded double-disc version in 1997.
The single-disc album has 15 or 18 tracks depending on the country of release, which span from 1979 to 1988
The double-disc US release has 33 songs ranging from 1979 to 1995,including several previously unreleased studio tracks.
The original cover art gained controversy, as it depicted a naked woman being stung by a column of scorpions.
An alternative cover with the woman airbrushed out was printed, which was used for the double-disc version
of the album, subtitled The Mercury Years.
